import api from "./services/api";
import { Games, Game } from "./model/games.model";
import { useEffect, useState } from "react";

const fetchGames = async () => {
  try {
    const data = await api.games.getGames();
    console.log(data);
    return data.games;
  } catch (error) {
    console.log("ERROR", error);
  } finally {
    console.log("FINALLY");
  }
};

export const Check = () => {
  const [games, setGames] = useState<Game[]>();
  useEffect(() => {
    fetchGames().then((data) => data && setGames(data));
    fetchGames().then((data) => console.log(data));
  }, []);

  return (
    <>
      <h1>hello</h1>
      {games &&
        games.map((game: Game) => {
          <h2 key={game.id}>{game.developer}</h2>;
          console.log(game.developer);
          console.log(game.genre);
        })}
    </>
  );
};
